webpackJsonp([97786326051841],{357:function(e,t){e.exports={data:{markdownRemark:{html:'<h2><a href="http://www.feie-test.com/">FEIE-Tester</a></h2>\n<p>This website helps digital nomads save money on their taxes.</p>\n<p><a href="https://medium.com/@anthonycastrio/how-to-pay-no-united-states-income-tax-while-traveling-the-world-2e6aaac69299">Read the blog post.</a></p>\n<h3>Software Used:</h3>\n<ul>\n<li><code>React.js</code> to build the webpage</li>\n</ul>\n<h2><a href="https://www.meetup.com/Amazon-Seller-Meetup-Los-Angeles/">Amazon Sellers LA</a></h2>\n<p>I remotely organized a monthly meetup in Los Angeles, CA with over 250 members.</p>\n<h2><a href="https://devpost.com/software/feelvision">FeelVision</a></h2>\n<p>FeelVision is a navigation tool built for the blind, who would normally rely on using white canes to walk. Using Leap Motion IR cameras and Pebble Smartwatch haptic feedback, we introduce a cane-free navigation environment while giving the blind ability to recognize what is in front of them through computer vision technology.</p>\n<p>This hackathon project won "Best Use of IBM Bluemix" at PennApps XII.</p>\n<p><img src="/images/projects/feelvision.jpg" alt="alt text" title="FeelVision navigation gloves"></p>\n<h3>Software Used:</h3>\n<ul>\n<li>\n<p><code>Pebble Smartwatch</code> for haptic feedback</p>\n</li>\n<li>\n<p><code>Leap Motion</code> for infrared cameras</p>\n</li>\n<li>\n<p><code>IBM Bluemix</code> for object detection and classification</p>\n</li>\n<li>\n<p><code>Python</code> for scripting</p>\n</li>\n</ul>\n<h2><a href="https://devpost.com/software/vroom-vroom">VRoom-VRoom</a></h2>\n<p>VRoom-VRoom is an immersive user experience that integrates virtual reality via an Oculus Rift. The user controls a miniature vehicle trapped inside a tabletop maze with the objective of finding the treasure hidden at the center of the labyrinth.</p>\n<p>This project won "Best Hardware Hack" at Hoya Hacks in Washington, D.C.</p>\n<p><img src="/images/projects/vroomvroom.jpg" alt="alt text" title="Cardboard maze built for VRoom-VRoom"></p>\n<h3>Software Used:</h3>\n<ul>\n<li>\n<p><code>Python</code> for scripting</p>\n</li>\n<li>\n<p><code>HTML</code> and <code>CSS</code> to build the webpage</p>\n</li>\n<li>\n<p><code>Cardboard</code> to build the maze (not software)</p>\n</li>\n</ul>\n<h2><a href="https://devpost.com/software/linux-driver-for-myo-armband">libmyolinux</a></h2>\n<p>We found out that the Myo Armband did not have native Linux support - so we decided to provide it!</p>\n<p>We reverse engineered the bluetooth protocol of the armband to provide a shared C library, libmyolinux, which allows the raw packet data to be interpreted and displayed to the user.</p>\n<p>This project won the Grand Prize at HackUMBC Fall 2014.</p>\n<h3>Software used:</h3>\n<ul>\n<li>\n<p><code>Python</code> for scripting</p>\n</li>\n<li>\n<p><code>Pygame</code> to build the interactive demo</p>\n</li>\n<li>\n<p><code>C</code> to process packet data</p>\n</li>\n<li>\n<p><code>Thalmic Myo Armband</code> to get gesture data</p>\n</li>\n</ul>\n<h2><a href="https://www.jshel.co/things/8-nose-hanging-on-physics-building">Eldritch Esbat</a></h2>\n<p>Hung an 8 foot tall paper-mache nose from the side of the Physics building.</p>\n<p><img src="/images/projects/nose.png" alt="alt text" title="large nose attached to the side of a building"></p>\n<h3><a href="https://devpost.com/AntCas">More Hackathon Projects</a></h3>',frontmatter:{date:"January 01, 2017",path:"/projects",title:"Side Projects"}}},pathContext:{}}}});
